def extract_property(claims, pid, ptype='statement'):
    props = claims[pid] if pid in claims else []
    ids = [p['mainsnak']['datavalue']['value']['id']
           for p in props
           if p['type'] == ptype and p['mainsnak']['datatype'] == 'wikibase-item' and 'datavalue' in p['mainsnak']]
    return ids


def extract_entity(entity):
    result = {
        'id': entity['id'],
        'type': entity['type']
    }

    labels = entity['labels'] if 'labels' in entity else {}
    result['labels'] = {labels[lan]['language']: labels[lan]['value']
                        for lan in labels
                        if lan.startswith('en') or lan.startswith('zh')}

    # descriptions = entity['descriptions'] if 'descriptions' in entity else {}
    # result['descriptions'] = {descriptions[lan]['language']: descriptions[lan]['value']
    #                           for lan in descriptions
    #                           if lan.startswith('en') or lan.startswith('zh')}

    aliases = entity['aliases'] if 'aliases' in entity else {}
    result['aliases'] = [aliases[lan]
                         for lan in aliases
                         if lan.startswith('en') or lan.startswith('zh')]

    claims = entity['claims'] if 'claims' in entity else {}
    result['instance_of'] = extract_property(claims, 'P31')
    result['subclass_of'] = extract_property(claims, 'P279')

    return result


def extract_relation(filename='wikidata-20170515-all.json'):
    with open(filename, 'r') as f:
        entities = []
        count = 0
        batch = 1
        for line in f:
            count += 1
            if count == 1:
                # skip the first line
                continue

            json_line = line.strip()
            if json_line.endswith(','):
                json_line = json_line[:-1]

            if not json_line.endswith('}'):
                # EOF
                break

            data = json.loads(json_line)
            try:
                entity = extract_entity(data)
            except Exception as ex:
                print(json_line)
                print(ex)
                break

            entities.append(entity)
            if len(entities) >= 100000:
                json.dump(entities, open('entities_{}.json'.format(batch), 'w'))
                batch += 1
                entities = []

        if entities:
            json.dump(entities, open('entities_{}.json'.format(batch), 'w'))


